Jaclyn Wright: The Two-Dimensional Shadow

Social media and other online outlets consume a significant amount of the average person’s time each day. But most people do not give much thought to how their browsing activity is recorded. Alarmed by the lack of privacy in our increasingly web-based world where personal information is gathered and exploited by various entities, photographer Jaclyn Wright created a series of photographs titled, The Two-Dimensional Shadow.&nbsp;

