Alejandro Durán: Washed Up

According to Alejandro Durán his Washed Up series “transforms the international debris washing up on Mexico’s Caribbean coast into aesthetic yet disquieting works.” Durán photographs the various waste he collects and makes into assemblages on site. “At times he distributes the objects the way the waves would; at other times, the plastic mimics algae, roots, rivers, or fruit, reflecting the infiltration of plastics into the natural environment.” In Brotes, Durán implants a number of washed-up toothbrushes into the earth as if they are plants shooting up from the ground. In Bombillas, lightbulbs appear on the shore, resembling creatures emerging from the sea to spawn their offspring. More than surreal landscapes, Durán’s images serve as a reminder of the dire consequences of worldwide environmental pollution. &nbsp;

